import React from 'react';
import './index.scss';

function BarChart(props) {
    return (
        <div className="bar-chart-container">
            <svg width="100%" height="100%">
                 <path d="M 10 10 V 100%" strokeWidth="2" stroke="red"/>

            </svg>
        </div>
    );
}

export default BarChart;
